MERGE INTO VipunenTK_DW.dbo.[_sa_K3_10_Tutk_suor_osuus_aloittaneista_korkeakoulut_nykytila_2] t
	USING (SELECT rivinro, aineistorivinumero, rivinumero FROM VipunenTK_DW.dbo.[_sa_K3_10_Tutk_suor_osuus_aloittaneista_korkeakoulut_nykytila_1]) s
		ON s.rivinro = t.rivinro
WHEN MATCHED THEN 
	UPDATE
		SET aineistorivinumero = s.aineistorivinumero,
			rivinumero = s.rivinumero;

